import React from "react";
import "./Login.css";

function MapDesign() {
  return (
    <div className="map-container">
      <div className="map-design">
        <div className="blue-bg">
        </div>
      </div>
      <div className="wvu-logo"></div>
    </div>
  );
}

export default MapDesign;
